import React, { useContext } from 'react';
import { Link, useLocation } from 'react-router-dom';
import { useTranslation } from 'react-i18next';
import { AuthContext } from '../../contexts/AuthContext';
import './BottomNavigation.css';

// Ícones como componentes SVG
const HomeIcon = ({ active }) => (
  <svg width="24" height="24" viewBox="0 0 24 24" fill="none" stroke={active ? "#4A66E2" : "#666"} strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
    <path d="M3 9l9-7 9 7v11a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2z"></path>
    <polyline points="9 22 9 12 15 12 15 22"></polyline>
  </svg>
);

const MapIcon = ({ active }) => (
  <svg width="24" height="24" viewBox="0 0 24 24" fill="none" stroke={active ? "#4A66E2" : "#666"} strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
    <path d="M21 10c0 7-9 13-9 13s-9-6-9-13a9 9 0 0 1 18 0z"></path>
    <circle cx="12" cy="10" r="3"></circle>
  </svg>
);

const AddIcon = () => (
  <svg width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="#fff" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
    <line x1="12" y1="5" x2="12" y2="19"></line>
    <line x1="5" y1="12" x2="19" y2="12"></line>
  </svg>
);

const ProfileIcon = ({ active }) => (
  <svg width="24" height="24" viewBox="0 0 24 24" fill="none" stroke={active ? "#4A66E2" : "#666"} strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
    <path d="M20 21v-2a4 4 0 0 0-4-4H8a4 4 0 0 0-4 4v2"></path>
    <circle cx="12" cy="7" r="4"></circle>
  </svg>
);

const BottomNavigation = () => {
  const { t } = useTranslation();
  const { isAuthenticated } = useContext(AuthContext);
  const location = useLocation();

  const isActive = (path) => location.pathname === path;

  return (
    <nav className="bottom-navigation">
      <Link to="/" className={`nav-item ${isActive('/') ? 'active' : ''}`}>
        <HomeIcon active={isActive('/')} />
        <span>{t('nav.home')}</span>
      </Link>

      <Link to="/map" className={`nav-item ${isActive('/map') ? 'active' : ''}`}>
        <MapIcon active={isActive('/map')} />
        <span>{t('nav.map')}</span>
      </Link>

      {isAuthenticated && (
        <Link to="/add-cat" className="nav-item add-button">
          <div className="add-icon-container">
            <AddIcon />
          </div>
        </Link>
      )}

      <Link 
        to={isAuthenticated ? "/profile" : "/login"} 
        className={`nav-item ${isActive('/profile') ? 'active' : ''}`}
      >
        <ProfileIcon active={isActive('/profile')} />
        <span>{isAuthenticated ? t('nav.profile') : t('auth.login')}</span>
      </Link>
    </nav>
  );
};

export default BottomNavigation;
